import React from 'react';
import { NavLink } from 'react-router-dom';


const Navigation = () => {
    return(
        <ul class="topnav">
            <li>
                <NavLink to="/" className="active">Home</NavLink>
            </li>
            <li>
                <NavLink to="/login">Login</NavLink>
            </li>
            <li>
                <NavLink to="/registration">Registration</NavLink>
            </li>
        </ul>
        
    );
}

export default Navigation;
